Y’all. It’s so cold. We aren’t dealing with the snow and ice here like a lot of you are, but it’s constant rain. Crank that fireplace and do some redecorating! That always lifts my spirits. My custom XOXO tic tac toe board is the BEST last piece to your happy coffee table styling. The pieces are green and blue paintings of mine printed  on clear acrylic and the board is backed in the most fun neon pink that practically glows when the light hits it. It’s electric ⚡️. And at $65, it’s the perfect Valentine’s Day gift for your sweetie or for yourself. These will be a available on my website Friday morning at 9 CST. 

